import React from "react";
import { Routes, Route, Link } from "react-router-dom";
function Login() {
  return (
    <div>
      <p>Login</p>
      <Link to="/Empresa">About</Link>
      <p>Conteúdo da página</p>
    </div>
  );
}
const Container = styled.div`
  display: flex;
  height: 100%;
  width: 100%;
`;
export default Login;
